import React from "react";
import { useGlobalContext } from "./context";


const Stories = () => {
    const {hits} = useGlobalContext()

  return (
    <>
  <div>Stories</div>
  {hits.map((curpost) => {
        return <h2>{curpost.title}</h2>
    })
  }
  </>
  );
};

export default Stories;
